import React from "react";
import { Box, Typography, Link } from "@mui/material";

const Header = () => {
  return (
    <Box
      sx={{
        height: "100vh",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        width: "100%",
      }}
    >
      <Typography variant="h1" mb={4} align="center">
        Fato ou Fake?
      </Typography>
      <Typography variant="article" align="center">
        Este projeto é um classificador treinado para nos ajudar a reconhecer a
        veracidade de uma notícia.
      </Typography>

      <Box my={4}>
        <Link href="#detector" sx={{ cursor: "pointer" }}>
          Verificar uma notícia
        </Link>
      </Box>
    </Box>
  );
};

export default Header;
